import { Box, Button, Grid, Input, Paper, TextField } from "@mui/material";
import React, { useRef } from "react";
import background from "../../images/wall2.jpeg";

const login = () => {
  const isMobile = useMobile({ breakpoint: "md" });
  return (
    <div>
      <Grid
        container
        sx={{ color: "black", marginTop: "50%" }}
        spacing={2}
        minHeight="100%"
      >
        <Grid item md={3} xs={12}>
          <div style={{ fontSize: "24px", marginBottom: "50px" }}>
            Welcome <br /> God to see you
          </div>
        </Grid>
        <Grid item md={3} xs={12}>
          <TextField
            size="small"
            sx={{ width: "80%" }}
            placeholder="Username"
          ></TextField>
        </Grid>
        <Grid item md={3} xs={12}>
          <TextField
            size="small"
            sx={{ width: "80%" }}
            placeholder="Password"
            type="password"
          ></TextField>
        </Grid>
        <Grid item md={3} xs={12}>
          <Button variant="contained" sx={{ width: "50%" }}>
            Login
          </Button>
        </Grid>
      </Grid>
    </div>
  );
};

export default login;
